import React from 'react';
import tim from './images/Tim1.jpeg'
import './About.css';



const About = () => {
    return (
        <div className='about'>
            <div className='container'>
                <img src={tim} alt='Tim' />
                <div className='col-2'>
                    <h2>Abou</h2>
                </div>
            </div>
        </div>
    )
}

export default About
